import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import api from "../api";

export default function AdminPage() {
  const navigate = useNavigate();
  const [patients, setPatients] = useState([]);
  const [form, setForm] = useState({
    fullName: "",
    personId: "",
    birthYear: "",
    mobileNo: "",
    status: "تحت الاجراء",
    travelStatus: 0,
    returnReason: "",
    categoryId: "1",
    internalStatusCode: 1
  });

  const loadPatients = async () => {
    try {
      const { data } = await api.get("/api/patients");
      setPatients(data);
    } catch (err) {
      if (err.response?.status === 401) {
        navigate("/login");
      }
    }
  };

  useEffect(() => {
    loadPatients();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await api.post("/api/patients", form);
    setForm({
      fullName: "",
      personId: "",
      birthYear: "",
      mobileNo: "",
      status: "تحت الاجراء",
      travelStatus: 0,
      returnReason: "",
      categoryId: "1",
      internalStatusCode: 1
    });
    loadPatients();
  };

  return (
    <div className="card shadow-sm border-0 w-100 mb-10">
      <div className="card-body py-10">
        <h2 className="text-center text-primary fw-bold mb-8">
          لوحة التحكم - إدارة المرضى
        </h2>

        {/* Form */}
        <form className="row g-4 mb-10" onSubmit={handleSubmit}>
          <div className="col-md-3">
            <label className="form-label">اسم المريض</label>
            <input
              type="text"
              name="fullName"
              className="form-control"
              value={form.fullName}
              onChange={handleChange}
              required
            />
          </div>

          <div className="col-md-3">
            <label className="form-label">رقم الهوية</label>
            <input
              type="text"
              name="personId"
              className="form-control"
              value={form.personId}
              maxLength={9}
              onChange={(e) =>
                handleChange({
                  target: {
                    name: "personId",
                    value: e.target.value.replace(/\D/g, "")
                  }
                })
              }
              required
            />
          </div>

          <div className="col-md-2">
            <label className="form-label">سنة الميلاد</label>
            <input
              type="text"
              name="birthYear"
              className="form-control"
              value={form.birthYear}
              maxLength={4}
              onChange={(e) =>
                handleChange({
                  target: {
                    name: "birthYear",
                    value: e.target.value.replace(/\D/g, "")
                  }
                })
              }
              required
            />
          </div>

          <div className="col-md-2">
            <label className="form-label">رقم الجوال</label>
            <input
              type="text"
              name="mobileNo"
              className="form-control"
              value={form.mobileNo}
              onChange={handleChange}
              required
            />
          </div>

          <div className="col-md-2">
            <label className="form-label">الحالة</label>
            <select
              name="status"
              className="form-select"
              value={form.status}
              onChange={handleChange}
            >
              <option value="تحت الاجراء">تحت الاجراء</option>
              <option value="معتمد">معتمد</option>
              <option value="متابعة محلية">متابعة محلية</option>
            </select>
          </div>

          <div className="col-md-2">
            <label className="form-label">Travel Status</label>
            <input
              type="number"
              name="travelStatus"
              className="form-control"
              value={form.travelStatus}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-3">
            <label className="form-label">سبب الإرجاع (إن وجد)</label>
            <input
              type="text"
              name="returnReason"
              className="form-control"
              value={form.returnReason}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-2">
            <label className="form-label">Category ID</label>
            <input
              type="text"
              name="categoryId"
              className="form-control"
              value={form.categoryId}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-2">
            <label className="form-label">Status Code</label>
            <input
              type="number"
              name="internalStatusCode"
              className="form-control"
              value={form.internalStatusCode}
              onChange={handleChange}
            />
          </div>

          <div className="col-12 text-center mt-4">
            <button type="submit" className="btn btn-primary px-10">
              حفظ المريض
            </button>
          </div>
        </form>

        {/* Table */}
        <div className="table-responsive">
          <table className="table table-row-dashed table-striped align-middle">
            <thead>
              <tr>
                <th>الاسم</th>
                <th>رقم الهوية</th>
                <th>سنة الميلاد</th>
                <th>الجوال</th>
                <th>الحالة</th>
                <th>Travel</th>
                <th>Category</th>
              </tr>
            </thead>
            <tbody>
              {patients.map((p) => (
                <tr key={p._id}>
                  <td>{p.fullName}</td>
                  <td>{p.personId}</td>
                  <td>{p.birthYear}</td>
                  <td>{p.mobileNo}</td>
                  <td>{p.status}</td>
                  <td>{p.travelStatus}</td>
                  <td>{p.categoryId}</td>
                </tr>
              ))}
              {patients.length === 0 && (
                <tr>
                  <td colSpan="7" className="text-center">
                    لا يوجد بيانات بعد
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
